import React from "react";

const LoginForm = () => {
  return (
    <form action="#">
      <div class="input-group mb-3">
        <span class="input-group-text">
          <i
            class="bx bxs-user-circle fs-5"
            style={{ marginRight: "10px" }}
            style={{ maxWidth: "30px", marginRight: "10px" }}
          />
          <input
            type="text"
            class="form-control form-control-mg"
            placeholder="E-mai"
          />
        </span>
      </div>
      <div class="input-group-mb-3">
        <span class="input-group-text" >
          <i
            class="bx bxs-lock-alt fs-5"
            style={{ marginRight: "10px" }}
          />
          <input
            type="password"
            class="form-control form-control-mg"
            placeholder="HasÅ‚o"
           />
        </span>
      </div>
    </form>
  );
};

export default LoginForm;
